import logo from './logo.svg';
import './App.css';
import axiosConfig from './api/axiosConfig';
import { useEffect, useState } from 'react';

function App() {
  const [cars, setCars] = useState([]);

  const getCars = async () => {
    const fetch = await axiosConfig.get("/api/v1/cars");
    setCars(fetch.data);
    console.log(fetch)
  };

  useEffect(() => {
    getCars();
  }, [])
  return (
    <div className="App">
      {cars.map((i, idx) => (
        <div key={idx}>

        </div>
      ))}
    </div>
  );
}

export default App;
